import './App.css';

const App = () => {


  return(

        <div className="container">
            <div className="header">HEADER</div>
            <div className="menu">MENUUUUUUUUUUUUUUUUUUUUUUU</div>
            <div className="content">CONTENT</div>
            <div className="extra">EXTRA</div>
            <div className="footer">FOOTER</div>
        </div>

    // <Router>
